import { useParams } from "react-router-dom";

const JokeDetails = () => {
  const params = useParams();
  return (
    <div>
      <h1>Jokes Details Page</h1>
      <p>{params.jokeId}</p>
    </div>
  );
};

export default JokeDetails;
